import React from 'react';

const Outbutton = () => {
  const containerStyle = {
    display: 'flex',  // Make sure it's a flex container
    alignItems: 'center', 
    justifyContent: 'center', // Adjust as needed
  };

  const buttonStyle = {
    fontSize: '1em',
    padding: '0.5em',
    animation: 'easeIn 2s ease-out',
    backgroundColor:'#7752FE',
    color:'#C2D9FF'
  };

  const styles=`
@keyframes easeIn{
    0%{opacity:0;transform:translateY(-120px);}
    100%{opacity:1;transform:translateX(-340);}

}`
;

  return (
    <div style={containerStyle}>
        <style>{styles}</style>
      <button style={buttonStyle}>Shorten</button>
    </div>
  );
};

export default Outbutton;
